import { React, useState } from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';
import { Button } from '@material-ui/core';
import { HamburgerElastic } from 'react-animated-burgers'
import { SideBar } from 'react-sidebar';

function changeSizeByBtn() {
    document.getElementById('text').style.fontSize = 95 +'px';
}
function decreaseSizeByBtn() {
    document.getElementById('text').style.fontSize = 50 +'px';
}
function stopVideo(){
    document.getElementById('vid').remove();  
}

function Navbar() {

    const [isOpen, setOpen] = useState(false);
    const handleClick = () => {
        setOpen(true);
    };
    const handleClose = () => {
        setOpen(false);
    };
   
    return (
            <nav className='navbar'>
                <div style={{ justifySelf: 'flex-start', alignSelf: 'center' }}> 
                        <Sidebar 
                            sidebar={<b>Sidebar content</b>}
                            open={this.state.sidebarOpen}
                        >
                            <Button 
                                variant="popover" 
                                onClick={handleClick}
                            >
                                <HamburgerElastic isActive={isOpen} barColor="white"/>
                            </Button>
                        </Sidebar>
                    </div>
                <div className='nav-container'>
                    <li className='nav-item'>
                        <Link to='/sign-up' className='nav-link'>
                            Sign Up
                        </Link>
                    </li>
                    <Link to='/' className='navbar-logo'>
                        TwoLlama Travels
                    </Link>
                    <li className='nav-item'>
                        <Link to='/log-in' className='nav-link'>
                            Log In
                        </Link>
                    </li>
                </div>
            </nav>
    )
}

export default Navbar;
